				@"{""response"":{""items"":[{""type"":""post"",""source_id"":-30666517,""date"":1444984263,""post_id"":1240982,""post_type"":""post"",""text"":""Как избежать распространенных ошибок на C#.\n\n#csharp@tproger #link@tproger"",""attachments"":[{""type"":""link"",""link"":{""url"":""http:\/\/tproger.ru\/links\/common-c-sharp-mistakes\/"",""title"":""  Самые распространенные ошибки новичков в C#"",""description"":""C# — язык со строгой статической типизацией. Это значит, что большая часть возможных ошибок будет обнаружена на этапе компиляции. Тем не менее, есть множес"",""photo"":{""id"":382830949,""album_id"":-2,""owner_id"":444318,""photo_75"":""http:\/\/cs628720.vk.me\/v628720318\/1dd0e\/gTckg-hdOy8.jpg"",""photo_130"":""http:\/\/cs628720.vk.me\/v628720318\/1dd0f\/zrRWbq2L31w.jpg"",""photo_604"":""http:\/\/cs628720.vk.me\/v628720318\/1dd10\/mqLkMPGpOb0.jpg"",""photo_807"":""http:\/\/cs628720.vk.me\/v628720318\/1dd11\/5GAEAgTyw8c.jpg"",""width"":696,""height"":327,""text"":"""",""date"":1444981359}}}],""post_source"":{""type"":""vk""},""comments"":{""count"":9,""can_post"":1},""likes"":{""count"":99,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":13,""user_reposted"":0}},{""type"":""post"",""source_id"":-26030283,""date"":1444983909,""post_id"":120324,""post_type"":""post"",""text"":"""",""attachments"":[{""type"":""photo"",""photo"":{""id"":382974698,""album_id"":-7,""owner_id"":-26030283,""user_id"":100,""photo_75"":""http:\/\/cs628330.vk.me\/v628330274\/186d3\/MgjxT-lVYHg.jpg"",""photo_130"":""http:\/\/cs628330.vk.me\/v628330274\/186d4\/1dgk4Vd5Gpg.jpg"",""photo_604"":""http:\/\/cs628330.vk.me\/v628330274\/186d5\/ZYDCeb0thy0.jpg"",""width"":604,""height"":377,""text"":""Original: http:\/\/cs7011.vk.me\/v7011764\/913b\/3CY9m0tlTYc.jpg"",""date"":1444983901,""post_id"":120324,""access_key"":""237080a194befeb18d""}}],""post_source"":{""type"":""vk""},""comments"":{""count"":0,""can_post"":0},""likes"":{""count"":1578,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":192,""user_reposted"":0}},{""type"":""post"",""source_id"":-12382740,""date"":1444983391,""post_id"":693747,""post_type"":""post"",""text"":""Сука ебашь рви душу"",""attachments"":[{""type"":""photo"",""photo"":{""id"":386021105,""album_id"":-7,""owner_id"":-12382740,""user_id"":100,""photo_75"":""http:\/\/cs7051.vk.me\/c7001\/v7001036\/1495e\/Yo1wD7RBKgc.jpg"",""photo_130"":""http:\/\/cs7051.vk.me\/c7001\/v7001036\/1495f\/L_zRrLXbvL4.jpg"",""photo_604"":""http:\/\/cs7051.vk.me\/c7001\/v7001036\/14960\/4opZWy-VcPQ.jpg"",""width"":604,""height"":453,""text"":"""",""date"":1444983391,""post_id"":693747,""access_key"":""71a53d4711e360dfd3""}}],""post_source"":{""type"":""vk""},""comments"":{""count"":0,""can_post"":0},""likes"":{""count"":4668,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":240,""user_reposted"":0}},{""type"":""post"",""source_id"":-32114286,""date"":1444983304,""post_id"":113537,""post_type"":""post"",""text"":""Я студент и я зарабатываю по 120 000 рублей в неделю! Ты тоже сможешь — читай как!\n\nМне никогда не хватало денег на жизнь.\nЯ студент 3-го курса педагогического университета, параллельно работаю, точнее работал, обычным консультантом в магазине. В месяц мой доход составлял 10-12 тысяч рублей. Этого не хватало ни на карманные расходы, ни на оплату жилья и учебу. Все это время я постоянно перебивался с копейки на копейку. А теперь я зарабатываю по 15-20 тысяч в день, сидя за компьютером. Хотите также?\n\nСейчас мне 22, я как и все, пошел получать высшее образование после школы. Уехав в другой город, я ждал красивой жизни, мечтал найти хорошую работу, стильно одеваться, но в итоге был вынужден работать обычным консультантом и жить в долг!\n\nСейчас я имею машину за 2 млн руб. И могу Вам смело сказать, что моя жизнь удалась. Я питаюсь в дорогих ресторанах, меня хотят все девушки. Что бы там не говорили, но деньги действительно кардинально меняют жизнь. Если сейчас вспоминать свою старую жизнь, то я даже боюсь в страшном сне увидеть ее. Ладно, не будем о плохом.\n\nКак же я смог столько зарабатывать? Дело в том, что меня совсем недавно уволили с работы... Я не опустил руки и, как в принципе и все, начал искать работу, которая подошла бы мне. Я хотел работать дома и желательно на себя! Знакомые, естественно, говорили, что у меня ничего не выйдет, родственники твердили — ищи работу за любые деньги... А деньги к тому моменту уже заканчивались... Оставалось несколько тысяч рублей....\n\nНовая работа, которая приносит сейчас по 15-20 тысяч в день, началась с обычной регистрации тут — http:\/\/vk.cc\/4iVKHi\n\nЯ видел и и не верил, что люди могут столько зарабатывать! Начинал я с минимальных ставок, в итоге вложил туда все свои сбережения! Каждые 24 часа я делал новый вклад и получал его назад уже с процентами от прибыли. \n\nРебята, всем кто сейчас находится в поисках работы, либо хочет на что-то накопить, скажу, что лучше, чем OlympTrade на данный момент в интернете работы нет! Естественно, лучше начинать сразу — просто попробуйте положить сумму, которую вам не жалко и убедитесь сами! Экспериментируйте за небольшие деньги, а если начнет получаться, то начинайте вкладывать больше!\n\nЕсли я Вас хоть чуточку замотивировал, то вот что советую сделать прямо сейчас:\n1. Зарегистрируйтесь на сайте — http:\/\/vk.cc\/4iVKHi\n2. Потренируйтесь на демо-счете (это бесплатно).\n3. Как только что-то будет получаться на демо-счете, пробуйте торговать на настоящем. \nИ помните, что через год вы будете очень жалеть, что не начали прямо сейчас.\nНа данный момент я знаю несколько человек, которые зарабатывают там даже больше, чем 30 тыс в день(около миллиона в месяц) и это не предел!"",""attachments"":[{""type"":""photo"",""photo"":{""id"":387206002,""album_id"":-7,""owner_id"":-32114286,""user_id"":100,""photo_75"":""http:\/\/cs7051.vk.me\/c7003\/v7003356\/ff27\/C-h1vsN6_Lk.jpg"",""photo_130"":""http:\/\/cs7051.vk.me\/c7003\/v7003356\/ff28\/KMNIRj4GSG