,""text"":""Да ты че не знаешь? Петрович умер...\n—  Да ты че!!! ! Как? ...\n—  Да пришел домой, выпил, лег на диван, закурил. .\n—  Че, сгорел, что ли? !!! ! !\n—  Да не... Успел он окно открыть и в форточку прыгнуть...\n—  Че разбился что ли? !!! !!! !\n—  Да не... Он перед тем как прыгать успел пожарных вызвать, они тент успели натянуть, он спружинил неудачно и опять в окно влетел... .\n—  Да епт, че все-таки сгорел? !!! !!! ! !\n—  Да не... Он за раму зацепился и обратно сиганул... . .\n—  Да б%я!!! ! Че разбился все таки что ли? !!! !!! !\n—  Да не... Там же пожарники с тентом, он спружинил и на проезжую часть, а там камаз тентованный шел. . он отскочил от него и обратно в окно...\n—  ДА ЕПТ!!! КАК ПОГИБ ТО!!!\n—  Да... Пристрелили на х*й. . Зае*ал всех!"",""post_source"":{""type"":""api""},""comments"":{""count"":9,""can_post"":1},""likes"":{""count"":290,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":68,""user_reposted"":0}},{""type"":""post"",""source_id"":-32114286,""date"":1444976125,""post_id"":113531,""post_type"":""post"",""text"":"""",""attachments"":[{""type"":""photo"",""photo"":{""id"":387197536,""album_id"":-7,""owner_id"":-32114286,""user_id"":100,""photo_75"":""http:\/\/cs7051.vk.me\/c7007\/v7007854\/23bf3\/HfGKfkEiimk.jpg"",""photo_130"":""http:\/\/cs7051.vk.me\/c7007\/v7007854\/23bf4\/3CtGN4Qd710.jpg"",""photo_604"":""http:\/\/cs7051.vk.me\/c7007\/v7007854\/23bf5\/M-0zFK846xQ.jpg"",""width"":361,""height"":604,""text"":"""",""date"":1444976124,""post_id"":113531,""access_key"":""6c7484f48043574000""}}],""post_source"":{""type"":""api""},""comments"":{""count"":0,""can_post"":0},""likes"":{""count"":763,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":63,""user_reposted"":0}},{""type"":""post"",""source_id"":-52035408,""date"":1444975695,""post_id"":28432,""post_type"":""post"",""text"":""Урок в школе. Неизменная Марья Ивановна:\n— Дети, что можно получить от курицы? Машенька!\n— Яйца.\n— Хорошо. Петенька!\n— Мясо.\n— Молодец. Ну а ты, Вовочка, что скажешь?\n— Не знаю.\n— Ну как же, Вовочка. Вот ты на чем спишь?\n— На лавке.\n— А под голову что кладешь?\n— Валенок.\n— Та-ак... А папа твой где спит?\n— На полу.\n— А под голову что кладет?\n— Второй валенок.\n— Ну а дедушка твой где спит?!!!\n— На печи.\n— А под голову что кладет?\n— Подушку.\n— Вот! А что можно получить, если подушку разрезать?\n— П%здюлей от дедушки можно получить!!!"",""post_source"":{""type"":""api""},""comments"":{""count"":1,""can_post"":1},""likes"":{""count"":292,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":62,""user_reposted"":0}},{""type"":""post"",""source_id"":-30666517,""date"":1444975547,""post_id"":1240909,""post_type"":""post"",""text"":""Как определить свою квалификацию.\n\n#link@tproger"",""attachments"":[{""type"":""link"",""link"":{""url"":""http:\/\/tproger.ru\/links\/programmer-competency-matrix\/"",""title"":""  Таблица для определения квалификации разработчика"",""description"":""При приеме на работу компании в требованиях указывают уровень квалификации, которому должен удовлетворять нанимаемый разработчик. Все это замечательно, но"",""photo"":{""id"":382800976,""album_id"":-2,""owner_id"":444318,""photo_75"":""http:\/\/cs628720.vk.me\/v628720318\/1dca6\/5M58u0WZS9g.jpg"",""photo_130"":""http:\/\/cs628720.vk.me\/v628720318\/1dca7\/r0E-kA5Z0fU.jpg"",""photo_604"":""http:\/\/cs628720.vk.me\/v628720318\/1dca8\/WeZ7MFmwopc.jpg"",""photo_807"":""http:\/\/cs628720.vk.me\/v628720318\/1dca9\/WBhhX7rqoI0.jpg"",""width"":640,""height"":373,""text"":"""",""date"":1444939226}}}],""post_source"":{""type"":""vk""},""comments"":{""count"":49,""can_post"":1},""likes"":{""count"":229,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":29,""user_reposted"":0}},{""type"":""post"",""source_id"":-22220341,""date"":1444975227,""post_id"":39176,""post_type"":""post"",""text"":"""",""attachments"":[{""type"":""photo"",""photo"":{""id"":3847