n"":59,""description"":""Before wandering the wasteland on November 10, watch the world of Fallout 4 come to life in this live-action trailer.  Welcome Home.\n\nTo learn more, visit Bethesda.net or visit these Fallout sites\n\nOfficial Website\nhttp:\/\/fallout4.com\n\nFacebook\nhttps:\/\/facebook.com\/fallout\n\nTwitter\nhttp:\/\/www.twitter.com\/fallout\n\nInstagram\nhttp:\/\/www.instagram.com\/fallout_game\n\nESRB RATING: Mature with Blood and Gore, Intense Violence, Strong Language and Use of Drugs."",""date"":1444973451,""views"":70319,""comments"":8,""photo_130"":""http:\/\/cs623427.vk.me\/u7948372\/video\/s_19013109.jpg"",""photo_320"":""http:\/\/cs623427.vk.me\/u7948372\/video\/l_a7288e1d.jpg"",""photo_800"":""http:\/\/cs623427.vk.me\/u7948372\/video\/x_c57e5551.jpg"",""photo_640"":""http:\/\/cs623427.vk.me\/u7948372\/video\/l_a7288e1d.jpg"",""access_key"":""21ca081654d77b4ccf""}},{""type"":""audio"",""audio"":{""id"":405696095,""owner_id"":2000325315,""artist"":""Dion and the Belmonts"",""title"":""The Wanderer (1961)"",""duration"":159,""date"":1444973451,""url"":""http:\/\/cs9-2v4.vk.me\/p22\/423e3c028a6b34.mp3?extra=mh21Wa8Y9PhMYO2rwRmgAcOgEwEaGObdkf63Dfp8bb4cg0dRNtTKObq0AjZjUYHaBiR25vGQ38whD-xPJOLN9rrhkKl5oLw1ZhQ"",""genre_id"":18}}],""post_source"":{""type"":""vk""},""comments"":{""count"":225,""can_post"":1},""likes"":{""count"":899,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":93,""user_reposted"":0}},{""type"":""post"",""source_id"":-52035408,""date"":1444972225,""post_id"":28420,""post_type"":""post"",""text"":""&#128170; КСБ 55 — источник «ПОЛЕЗНОГО БЕЛКА».\nЭффективное средство для наращивания мышечной массы и сжигания подкожного жира !! Скидка 50%\n&#128175; Гарантия качества &#128077;\n&#128175; Безопасно для здоровья&#127807;\n&#128175; Быстрый и эффективный результат &#127942;\n\n&#128233; Оплата заказа при получении на почте.\n&#9999;Посмотреть и заказать &#10145; http:\/\/ksb.megatovarnik.ru\/zOEzQL\/&#11013;\n&#128222; Оформление заказа в течении 15 минут по телефону."",""attachments"":[{""type"":""photo"",""photo"":{""id"":383981590,""album_id"":-7,""owner_id"":-52035408,""user_id"":100,""photo_75"":""http:\/\/cs7010.vk.me\/v7010523\/ef65\/HumQ1YAVu88.jpg"",""photo_130"":""http:\/\/cs7010.vk.me\/v7010523\/ef66\/LsSfY8nwpQ4.jpg"",""photo_604"":""http:\/\/cs7010.vk.me\/v7010523\/ef67\/3oMwe61kHgU.jpg"",""width"":604,""height"":448,""text"":"""",""date"":1444942888,""access_key"":""464542524660d273a6""}},{""type"":""photo"",""photo"":{""id"":383981591,""album_id"":-7,""owner_id"":-52035408,""user_id"":100,""photo_75"":""http:\/\/cs7010.vk.me\/v7010523\/ef57\/yXXoGwHn8Oo.jpg"",""photo_130"":""http:\/\/cs7010.vk.me\/v7010523\/ef58\/vmPmUvkOIko.jpg"",""photo_604"":""http:\/\/cs7010.vk.me\/v7010523\/ef59\/lJBJSo1c-iU.jpg"",""width"":560,""height"":380,""text"":"""",""date"":1444942888,""access_key"":""9dc40a8ff71904f01e""}},{""type"":""photo"",""photo"":{""id"":383981592,""album_id"":-7,""owner_id"":-52035408,""user_id"":100,""photo_75"":""http:\/\/cs7010.vk.me\/v7010523\/ef49\/mhFoWMP8Ijs.jpg"",""photo_130"":""http:\/\/cs7010.vk.me\/v7010523\/ef4a\/GLlFfBFDD0k.jpg"",""photo_604"":""http:\/\/cs7010.vk.me\/v7010523\/ef4b\/r2osj4OMbxk.jpg"",""width"":604,""height"":604,""text"":"""",""date"":1444942888,""access_key"":""adae429f9b803f76ee""}},{""type"":""photo"",""photo"":{""id"":383981593,""album_id"":-7,""owner_id"":-52035408,""user_id"":100,""photo_75"":""http:\/\/cs7010.vk.me\/v7010523\/ef50\/wv0Vsh9XH3M.jpg"",""photo_130"":""http:\/\/cs7010.vk.me\/v7010523\/ef51\/nnb8dapBuTw.jpg"",""photo_604"":""http:\/\/cs7010.vk.me\/v7010523\/ef52\/FNln9XO6pHw.jpg"",""width"":600,""height"":604,""text"":"""",""date"":1444942888,""access_key"":""ba80b2b22754f6dc9a""}},{""type"":""photo"",""photo"":{""id"":383981594,""album_id"":-7,""owner_id"":-52035408,""user_id"":100,""photo_75"":""http:\/\/cs7010.vk.me\/v7010523\/ef5e\/CB7hzd_k37w.jpg"",""photo_130"":""http:\/\/cs7010.vk.me\/v7010523\/ef5f\/SxI5sZ_oqrQ.jpg"",""photo_604"":""http:\/\/cs7010.vk.me\/v7010523\/ef60\/KoEu9U_ajwI.jpg"",""width"":585,""height"":313,""text"":"""",""date"":1444942888,""access_key"":""633cf89b975608b1fc""}}],""post_source"":{""type"":""vk""},""comments"":{""count"":0,""can_post"":1},""likes"":{""count"":7,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":0,""user_reposted"":0}},{""type"":""post"",""source_id"":-52035408,""date"":1444971744,""post_id"":28416,""post_type"":""post"",""text"":""Сидят 3 мужика спорят у кого самый страшный звук в жизни был:\n— я в шахте работаю глубина 1000 метров. Тут крепы затрещали, обвал...- самый страшный звук.\n— не х@ня все это я вот по весне на льду рыбачу, а тут везде лед затрещал...- самый страшный звук.\n— херня все это. Я вот лежу любовницу тр@х@ю тут муж залетает и меня за яйца ловит............... и самый страшный звук был когда он пытался зубами перочинный нож открыть...."",""post_source"":{""type"":""api""},""comments"":{""count"":0,""can_post"":1},""likes"":{""count"":207,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":27,""user_reposted"":0}},{""type"":""post"",""source_id"":-30532220,""date"":1444971600,""post_id"":82430,""post_type"":""post"",""text"":"""",""attachments"":[{""type"":""photo"",""photo"":{""id"":382621718,""album_id"":-7,""owner_id"":-30532220,""user_id"":100,""photo_75"":""http:\/\/cs543104.vk.me\/v543104789\/8d29\/LqTnq1Vs4K8.jpg"",""photo_130"":""http:\/\/cs543104.vk.me\/v543104789\/8d2a\/bc6PF1XA0Zs.jpg"",""photo_604"":""http:\/\/cs543104.vk.me\/v543104789\/8d2b\/xlrZCrk2Lao.jpg"",""width"":604,""height"":197,""text"":"""",""date"":1444971600,""post_id"":82430,""access_key"":""60598076a4872add85""}}],""post_source"":{""type"":""api""},""comments"":{""count"":0,""can_post"":0},""likes"":{""count"":2208,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":139,""user_reposted"":0}},{""type"":""post"",""source_id"":-52035408,""date"":1444970425,""post_id"":28413,""post_type"":""post"",""text"":""Встречаются два мужика на том свете: \n- Ты как умер? \n- Замерз. А ты как? \n- От смеха умер. \n- Это как? \n- Был я у любовницы, звонок в дверь, я в панику. Муж. Она ему мусорное ведро в дверь подала, пока он ходил, я оделся и ушел. Прихожу домой, звоню, а жена мне ведро протягивает. Я все понял ворвался в квартиру, все перерыл, а никого не нашел. Сел на диван, смеялся, смеялся, от смеха и умер. \n- Дурак! Заглянул бы в холодильник - оба бы живы остались."",""post_source"":{""type"":""api""},""comments"":{""count"":3,""can_post"":1},""likes"":{""count"":372,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":58,""user_reposted"":0}},{""type"":""post"",""source_id"":-30666517,""date"":1444968326,""post_id"":1240888,""post_type"":""post"",""text"":""Несколько сайтов, на которых вы можете порешать задачи на программирование и поучаствовать в соревнованиях. Испытайте себя!"",""attachments"":[{""type"":""link"",""link"":{""url"":""http:\/\/tproger.ru\/digest\/competitive-programming-practice"",""title"":""  Сайты с задачами на программирование"",""description"":""В последнее время набирает популярность такое явление, как «спортивное программирование». Его суть в том, что участники (отдельно или командами по трое и м"",""photo"":{""id"":385493702,""album_id"":-2,""owner_id"":235686439,""photo_75"":""http:\/\/cs625419.vk.me\/v625419439\/4db34\/vEm_5VGcRCA.jpg"",""photo_130"":""http:\/\/cs625419.vk.me\/v625419439\/4db35\/rSkiMBpKT-M.jpg"",""photo_604"":""http:\/\/cs625419.vk.me\/v625419439\/4db36\/2HcdR6566HA.jpg"",""width"":150,""height"":80,""text"":"""",""date"":1444931625}}}],""post_source"":{""type"":""vk""},""comments"":{""count"":15,""can_post"":1},""likes"":{""count"":511,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":68,""user_reposted"":0}},{""type"":""post"",""source_id"":-52035408,""date"":1444968046,""post_id"":28408,""post_type"":""post"",""text"":""Преамбула:\nПитер. Маляры стоя на лесах  реставрируют некое здание. Внизу площадь, фонтан, люди ходят... И так  случилось, что захотелось одному  по малой нужде. А слезать неохота. Он и  говорит второму:\n—  Дай-ка я прям сверху...\n—  Ты что, там же люди ходят!\n—  А ты меня придержи за пояс, я тогда чуток свешусь — и прям в фонтан!\nДоговорились. Один держит, другой штаны  расстегивает, и тут первый возьми да и чихни! Второй так и полетел...\nАмбула:\nГод спустя. В кафе беседуют три американки. Спорят, в какой стране  самые  cекcуальные мужчины. Одна  говорит:\n—  Была недавно во Франции. Там таакие французы!.. И галантные и изящные,  а уж какие любовники! Все в постель норовят заманить!\nДругая:\n—  Ой, да ладно тебе я вот в Мексике была, там та-акие мачо! Все потные,  волосатые, взглядом так и раздевают, сперма чуть не из ушей течет!\nТретья:\n—  Ой, девки, это все фигня! Вот была недавно в России...\nПервые две:\n—  Ну-у?!\n—  Вот гуляю там по площади, вдруг слышу крик. Поднимаю голову, смотрю:  летит на меня мужик, глаза бешеные, штаны расстегнуты, руками за член  держится и кричит:\n—  П@здаааааааа!!!"",""post_source"":{""type"":""api""},""comments"":{""count"":2,""can_post"":1},""likes"":{""count"":165,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":20,""user_reposted"":0}},{""type"":""post"",""source_id"":-30532220,""date"":1444968001,""post_id"":82426,""post_type"":""post"",""text"":"""",""attachments"":[{""type"":""photo"",""photo"":{""id"":382619483,""album_id"":-7,""owner_id"":-30532220,""user_id"":100,""photo_75"":""http:\/\/cs543104.vk.me\/v543104789\/8d1b\/NiVCJB3x0ss.jpg"",""photo_130"":""http:\/\/cs543104.vk.me\/v543104789\/8d1c\/nSMA_mc6rI0.jpg"",""photo_604"":""http:\/\/cs543104.vk.me\/v543104789\/8d1d\/hWMtcK02vlM.jpg"",""width"":355,""height"":533,""text"":"""",""date"":1444968000,""post_id"":82426,""access_key"":""699a1c0e937fe3bb58""}}],""post_source"":{""type"":""api""},""comments"":{""count"":0,""can_post"":0},""likes"":{""count"":2597,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":167,""user_reposted"":0}},{""type"":""post"",""source_id"":-52035408,""date"":1444964451,""post_id"":28407,""post_type"":""post"",""text"":""В 19-м веке студенты учили французский - наваляли Наполеону, дошли до Парижа... В 20-м учили немецкий - наваляли Гитлеру, дошли до Берлина... Сейчас все учат английский - зря американцы к нам лезут, ой зря..."",""post_source"":{""type"":""api""},""comments"":{""count"":0,""can_post"":1},""likes"":{""count"":431,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":81,""user_reposted"":0}},{""type"":""post"",""source_id"":-52035408,""date"":1444960832,""post_id"":28405,""post_type"":""post"",""text"":""Пожар в больнице. Пожарные все потушили. Подходят к главврачу:\n— Есть жертвы. В подвале было трое. Двоих мы откачали, одного не смогли.\nГлавврач теряет сознание. Его откачивают и спрашивают, что с ним.\n— Ребята, у нас там морг вообще-то."",""post_source"":{""type"":""api""},""comments"":{""count"":0,""can_post"":1},""likes"":{""count"":374,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":60,""user_reposted"":0}},{""type"":""post"",""source_id"":-52035408,""date"":1444957272,""post_id"":28397,""post_type"":""post"",""text"":""Меломан\nВчера ходили на концерт с благоверной. В филармонию. Не сказать, чтобы я был любитель, но жена да, а мне — по приколу. В суете перед концертом, да после пива забыл, а когда по ходу обнаружил, было поздно: сидели в самом партере прямо напротив музыкантов. Хотелось по-маленькому, и как-то подлюче нестерпимо сильно.\nПоначалу боролся с позывами незаметно, но потом муки видимо стали отражаться на лице. После добавил движения, похожие на корчи паралитика. Как не странно, помогало, хотя терпеть было часа полтора наверное. Где-то посредине каторги обнаружил изменения в лицах окружающих. Когда понял, что происходило, реально чуть не обоссался.\nКак бывалые, так и редко захаживающие зрители неподдельно меня зауважали.\nВедь я сопереживал фугам и кантатам не по-деццки. Я был весь в трагедии. Мучился в такт с давно ушедшими творцами. Звуки музыки проникали в самое мое нутро, заставляя содрагаться. Лицо мое негодовало и страдало. Глаза плакали. Я был самый Настоящий меломан."",""post_source"":{""type"":""api""},""comments"":{""count"":3,""can_post"":1},""likes"":{""count"":98,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":6,""user_reposted"":0}},{""type"":""post"",""source_id"":-12382740,""date"":1444954419,""post_id"":693723,""post_type"":""post"",""text"":"""",""attachments"":[{""type"":""photo"",""photo"":{""id"":386001200,""album_id"":-7,""owner_id"":-12382740,""user_id"":100,""photo_75"":""http:\/\/cs7051.vk.me\/c7001\/v7001170\/15330\/XQJ1UEMKjSk.jpg"",""photo_130"":""http:\/\/cs7051.vk.me\/c7001\/v7001170\/15331\/Buy7zmpBrwg.jpg"",""photo_604"":""http:\/\/cs7051.vk.me\/c7001\/v7001170\/15332\/kI0FEIXRS9Y.jpg"",""width"":604,""height"":403,""text"":"""",""date"":1444954418,""post_id"":693723,""access_key"":""27e1f430d1071ddad5""}}],""post_source"":{""type"":""vk""},""comments"":{""count"":0,""can_post"":0},""likes"":{""count"":13807,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":697,""user_reposted"":0}},{""type"":""post"",""source_id"":-12382740,""date"":1444954052,""post_id"":693720,""post_type"":""post"",""text"":"""",""attachments"":[{""type"":""photo"",""photo"":{""id"":386001128,""album_id"":-7,""owner_id"":-12382740,""user_id"":100,""photo_75"":""http:\/\/cs7051.vk.me\/c7001\/v7001085\/148e3\/t7wF2TIjYj0.jpg"",""photo_130"":""http:\/\/cs7051.vk.me\/c7001\/v7001085\/148e4\/zYdq0nxFPYI.jpg"",""photo_604"":""http:\/\/cs7051.vk.me\/c7001\/v7001085\/148e5\/EF7VLeWgiq8.jpg"",""width"":604,""height"":318,""text"":"""",""date"":1444954051,""post_id"":693720,""access_key"":""0c90b9d0920a202e11""}}],""post_source"":{""type"":""vk""},""comments"":{""count"":0,""can_post"":0},""likes"":