_post"":1},""likes"":{""count"":245,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":43,""user_reposted"":0}},{""type"":""post"",""source_id"":-52035408,""date"":1444950043,""post_id"":28379,""post_type"":""post"",""text"":""Две девушки обсуждают парня, с которым одна из них недавно познакомилась.\nИ вот у них такой диалог:\n— И теперь я вся в муках!\n— Каких? Дать не дать?\n— Звонить не звонить. Дать-то точно дам."",""post_source"":{""type"":""api""},""comments"":{""count"":1,""can_post"":1},""likes"":{""count"":188,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":13,""user_reposted"":0}},{""type"":""post"",""source_id"":-32114286,""date"":1444949760,""post_id"":113527,""post_type"":""post"",""text"":"""",""attachments"":[{""type"":""photo"",""photo"":{""id"":387185539,""album_id"":-7,""owner_id"":-32114286,""user_id"":100,""photo_75"":""http:\/\/cs543104.vk.me\/v543104789\/8cb3\/TFgFsmzgCSk.jpg"",""photo_130"":""http:\/\/cs543104.vk.me\/v543104789\/8cb4\/RwX0wb0WiF0.jpg"",""photo_604"":""http:\/\/cs543104.vk.me\/v543104789\/8cb5\/CzRDk-oLoe0.jpg"",""width"":577,""height"":348,""text"":"""",""date"":1444949760,""post_id"":113527,""access_key"":""d360a0ec5021278926""}}],""post_source"":{""type"":""api""},""comments"":{""count"":0,""can_post"":0},""likes"":{""count"":604,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":40,""user_reposted"":0}},{""type"":""post"",""source_id"":-32114286,""date"":1444948557,""post_id"":113526,""post_type"":""post"",""text"":"""",""attachments"":[{""type"":""photo"",""photo"":{""id"":387184940,""album_id"":-7,""owner_id"":-32114286,""user_id"":100,""photo_75"":""http:\/\/cs7051.vk.me\/c7007\/v7007854\/23bec\/raZ4JOHYjns.jpg"",""photo_130"":""http:\/\/cs7051.vk.me\/c7007\/v7007854\/23bed\/V78LFuOpS0o.jpg"",""photo_604"":""http:\/\/cs7051.vk.me\/c7007\/v7007854\/23bee\/xKSSW6Ot5B8.jpg"",""width"":604,""height"":452,""text"":"""",""date"":1444948556,""post_id"":113526,""access_key"":""4d4d4a6e9b0c01cabb""}}],""post_source"":{""type"":""api""},""comments"":{""count"":0,""can_post"":0},""likes"":{""count"":891,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":118,""user_reposted"":0}},{""type"":""post"",""source_id"":-52035408,""date"":1444947601,""post_id"":28373,""post_type"":""post"",""text"":""Профессор рассказывает о воинах Александра Македонского.\nНу и касается того, что мол войска годами пребывали в походах и это сплачивало воинов настолько, что они как правило влюблялись друг в друга. И это поощрялось, ибо легионер потерявший друга и любовника в одном лице, был беспощаден к врагу и мстил за убитого. И тут один очкастенький щуплый студент хихикает:\n— Значит легионеры были педиками?\nПрофессор тяжело вздохнул, снял очки, посмотрел на выскочку и говорит:\n— Педики говорите? Да не дай вам бог милый юноша, повстречаться хоть с одним таким педиком лицом к лицу. Нет, мой юный друг, это были не, как вы изволили выразиться, педики! Педики — это моисеев и трубач!\nА греки были настоящими БОЕВЫМИ ПИДАРАСАМИ! !"",""post_source"":{""type"":""api""},""comments"":{""count"":10,""can_post"":1},""likes"":{""count"":188,""user_likes"":0,""can_like"":1,""can_publish"":1},""reposts"":{""count"":31,""user_reposted"":0}}],""profiles"":[{""id"":444318,""first_name"":""Артём"",""last_name"":""Артемьев"",""sex"":2,""screen_name"":""cptn_foxmk"",""photo_50"":""http:\/\/cs952.vk.me\/v952318\/1c\/c4b5F-s5XcY.jpg"",""photo_100"":""http:\/\/cs952.vk.me\/v952318\/1b\/eOC-iVXvIoA.jpg"",""online"":0},{""id"":9918075,""first_name"":""Оля"",""last_name"":""Шульгина"",""sex"":1,""screen_name"":""olgashulgina"",""photo_50"":""http:\/\/cs629500.vk.me\/v629500075\/c78\/5nnPKG6ta5E.jpg"",""photo_100"":""http:\/\/cs629500.vk.me\/v629500075\/c77\/iliyrzeJXfg.jpg"",""online"":0},{""id"":22241772,""first_name"":""Марина"",""last_name"":""Прокофьева"",""sex"":1,""screen_name"":""anushes"",""photo_50"":""http:\/\/cs624917.vk.me\/v624917772\